import {makeStyles} from '@material-ui/core/styles';


export default makeStyles(() => ({
    appBar: {
        backgroundColor: '#057786',
        display: 'flex',
        flexDirection: 'column',
        marginTop: '20px'
    },
    //Fix this button ASAP! It looks horrible
    addButton: {
        position: 'absolute',
        width: '76px',
        height: '68px',
        left: '1330px',
        top: '39px',
        background: '#057786',
        // boxShadow: '0px 4px 4px rgba(0, 0, 0, 0.25)'
        outline: '#057786',
        borderRadius: '50%',
        color: '#FFFFFF',
        fontSize: '2rem'
    }
}))
